import React from 'react'

const TrendingCoin = ({ coin }) => {
    return (
        <div>
            <div>{coin.score}</div>
            <div>{coin.name}</div>
            <div>{coin.large}</div>
        </div>
    )
}

const TrendingCoinList = ({ coin }) => {
    return (
        <div className='h-screen'>
            HS
            <TrendingCoin coin={coin} key={coin.id}/>
        </div>
    )
}

const Home = ({ TrendingJSON }) => {
    return (
        <TrendingCoinList coin={TrendingJSON}/>
    )
}

export default Home

